<div id="bousou">
  <div class="heading">
<h4>
特徴</h4>
</div>
  シート類の固定に必需品の抑えピンです！<br>
  おてんとさんオリジナル商品なので、品質と低価格を実現！！<br>
  コストパフォーマンスに優れた商品です。<br>
  <br>
<div class="heading">
<h4>
サイズ・規格</h4>
</div>
  ・丸型皿（ワッシャー）　直径　約6cm　<br>
  ・ピン　長さ 約15cm <br>
  <br>
<div class="heading">
<h4>用途</h4>
</div>
  防草シート、マルチ、ブルーシート、不織布など各種シートやネット類の固定<br>
<br>
<div class="heading">
<h4>
使い方</h4>
</div>
  丸型皿（ワッシャー）にピンを通し、シートの固定したい箇所にハンマー等で打ちつけるだけと<br>
  とっても簡単です！<br>
<br>
  ☆防草シートの場合、約1m間隔でピンを使用して固定するとよいです。<br>
  <br>
  ≪例　幅1m×長さ10mのシートの場合≫<br>
  1m間隔で固定すると、片側11個使用する計算となります。<br>
  両側を固定するので、倍の22個必要となります。（※数はあくまで目安となります。）<br>
  <br>
<div class="heading">
<h4>
使用上の注意</h4>
</div>
  ・ピンをハンマー等で叩く際、強く叩き過ぎないようにしてください。<br>
  （ピンが変形したり、皿部分が破損してしまう場合がございます。）<br>
  <br>
  ・設置場所の地面が硬い場合は、ピンの長さが短めのものをご使用ください。<br>
  （長いピンを使用すると、なかなか入っていかず途中で曲がってしまう場合がございます。）
<br>
  <br>
