<img src="http://image.rakuten.co.jp/otentosan/cabinet/img59439528.jpg"/>

玄武岩を高温で焼き綿状にしたものでpH濃度を植物によい弱酸性に保つ効果があります。<br>
成分が均一で安定しているので生育のコントロールがしやすく、軽くて、土の流出が無くて清潔です。<br>
また無菌の為挿し木・種まきに最適です。<br>
※使用後はバラして土に混ぜると、土壌改良剤として使えます。<table width="773"> <tbody> <tr> <td></td> </tr> </tbody> </table>





